Rocky 4 1985

Verenigde Staten
Actie / Drama
91 minuten

geregisseerd door Sylvester Stallone
met Sylvester Stallone, Carl Weathers en Dolph Lundgren

Wanneer Rocky's vriend Apollo Creed doodgeslagen wordt tijdens een 
gevecht met de superfitte Russische bokser Ivan Drago, geeft Rocky 
zichzelf hier de schuld van. Opgehitst door de arrogantie van de Rus 
besluit Rocky het gevecht met hem aan te gaan, dit keer echter 
in Rusland
